INSERT INTO `apptopics` (`ID`, `Name`, `Description`, `Skill_id`, `code`, `video`, `developerid`) VALUES
(1, 'How to insert image in MYSQL using PHP', 'In this section we are going to learn how to pick image using html tag , get name of picture as well as path and convert into base64 and upload in database thank you', 3, 'Database table look like:\r\nCREATE TABLE `image` (\r\n`image` LONGBLOB NOT NULL\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1;\r\n\r\nphp page look like:\r\n<!DOCTYPE html>\r\n<html>\r\n<head>\r\n    <title>Insert Image in MySql using PHP</title>\r\n</head>\r\n<body>\r\n<?php\r\n$msg = \'\';\r\nif($_SERVER[\'REQUEST_METHOD\']==\'POST\'){\r\n    $image = $_FILES[\'image\'][\'tmp_name\'];\r\n    $img = file_get_contents($image);\r\n    $con = mysqli_connect(\'localhost\',\'root\',\'\',\'admin\') or die(\'Unable To connect\');\r\n    $sql = \"insert into images (image) values(?)\";\r\n\r\n    $stmt = mysqli_prepare($con,$sql);\r\n\r\n    mysqli_stmt_bind_param($stmt, \"s\",$img);\r\n    mysqli_stmt_execute($stmt);\r\n\r\n    $check = mysqli_stmt_affected_rows($stmt);\r\n    if($check==1){\r\n        $msg = \'Image Successfullly UPloaded\';\r\n    }else{\r\n        $msg = \'Error uploading image\';\r\n    }\r\n    mysqli_close($con);\r\n}\r\n?>\r\n<form action=\"\" method=\"post\" enctype=\"multipart/form-data\">\r\n    <input type=\"file\" name=\"image\" />\r\n    <button>Upload</button>\r\n</form>\r\n<?php\r\n    echo $msg;\r\n?>\r\n</body>\r\n</html>', 'https://www.youtube.com/watch?v=1NiJcZrPHvA', 1);
